@christinach I tried this out on staging. 
I would have expected this to tell me that I am expanding or collapsing something like: https://www.w3.org/TR/wai-aria-practices-1.1/examples/accordion/accordion.html

`aria-expanded="false"` vs `aria-expanded="true"` I think would do it.  Otherwise the unsighted person has no idea what clicking the button just did.
